## 1.entry point

```dart[first.dart]
void main() {

}
```

main 함수는 프로그램의 entry point로 필수적이다.

## 2.Variable declaration and initialization

> Variable declaration | Variable initialization
>
> > String name = 'Jerry' ;
>
> type Variable-Name assignment String literal terminator

VariableName 은 항상 camelCase 를 따른다.

## 3. Basic types

```dart[main.dart]
void main() {
    String name = 'jerry'; // String literal
    int age = 36; // integer up to 64 bit precision
    double height = 1.84; // double 64bit floating point
    bool likesDart = true; // Bool
}
```

- BuiltIn Type : String, int, double, bool.

- You don't need to declare variables with an explicit type.
- type inference.

## 4.String concatenation & interpolation

- concatenation

  - `print("My name is" + firstName + " " + lastName);`

- interpolation

  - `print("My name is $firstName $lastName");`
  - `print("Next year I will be ${age + 1} years old.");`

## 5. String escaping

    - `print("Today I'm felling great")`
    - `print('Today I\'m felling great')`
    - raw String `print(r'C:\Windows\system32')`

## 6. Multi-line strings

```
void main() {
    String s = """
    This is a short sentence.
    This is a longer sentence, with some more things in it.
    """
}
```

## 7. function , method

```
void main() {
    String title = 'Dart course';
    print(title.toUpperCase());
    // print - this is a function
    // toUpperCase - this is a method
}
```

## 8. Initialization vs Assignment

```
void main() {
    // Initialization
    String title = 'Dart course';
    // Assignment
    title = title.toLowerCase();
}
```

- expressions can be assigned to variables
- or passed to functions as arguments

## 9. Finding and replacing strings

```
void main() {
    String lovePizza = 'I love pizza';
    print(lovePizza.contains('pizza'));
    String lovePasta = lovePizza.replaceAll('pizza','pasta');
    print(lovePasta);
}
```

## 10. type conversions

- Dart is a strongly-typed language

```
void main() {
    int age = 36;
    String ageString = age.toString();
    String ratingString = '4.5';
    double rating = double.parse(ratingString);
    String helloString = 'hello';
    // exception occurred and aborted...
    print(double.parse(helloString));
}
```

## 11. Expressions & statements

- expressions : hold a value at runtime. (return value)

- statements : do not hold a value.

## Lists (also known as Arrays)

```dart
void main() {
    // List Literal...
    var cities = ['London', 'Paris', 'Moscow'];
    // [] is called subscript operator...
    print(cities[1]);
    // for-in loop iterate collections....
    for(var city in cities) {
        print(city);
    }
}
```

## List methods

```dart
void main() {
    // List Literal...
    var cities = ['London', 'Paris', 'Moscow'];
    print(cities.length);
    print(cities.isEmpty);
    cities.add('Seoul');
    cities.insert(1,'Busan')
    cities.removeAt(2);
    cities.clear();
    cities.contains('Moscow');
    cities.indexOf('Moscow');
}
```

## type annotations with lists

```dart
void main() {
    // List Type Annotation Literal...
    var cities = <String>['London', 'Paris', 'Moscow'];
    List<String> cities_2 = ['London', 'Paris', 'Moscow'];
}
```

## Using var, final, const with lists

```dart
void main() {
    // List Type Annotation Literal...
    final cities = <String>['London', 'Paris', 'Moscow'];
    // final variables can't be re-assigned
    // error
    cities = ['Venice'];
    // but you can still modify their contents.
    cities[1] = 'Venice';

    // do not allow both.
    const cities_2 = [];
}
```

## Set

- Sets are collections of unique values
- Lists can contain duplicate values

```dart
void main() {
    // Set literal...
    var countries = {'Italy', 'UK', 'Russia'};
    // No Subscript Operator...
    countries.elementAt(0);
    countries.add('Iceland');
    countries.remove('Italy');

    var euCountries = {'Italy', 'UK', 'Russia'};
    var asianCountries = {'India','China','Russia'};
    euCountries.union(asianCountries);
    euCountries.intersection(asianCountries);
    euCountries.difference(asianCountries);
}
```

## Maps (dictionaries)

- collection of key-value pairs.

```dart
void main() {
    // var/final/const or explicitly declare the type....
    Map<String,dynamic> person = {
        'name': 'Jerry',
        'age': 36,
    }
}
```

## 1. Static vs Dynamic

- Static : types are checked at compile time.
- Dynamic : types are checked on the fly, during execution.

```dart[exam1.dart]
void main() {
    String name = 'Jerry';
    // reassignment error.
    // sound type system.
    name = 10;
}
```

## 2. type inference with var

```dart[exam2.dart]
void main() {
    // infer type using var
    var name = 'Jerry';
    // also reassignment error.
    name = 10;
}
```

## 3. the final keyword

- final : declare and initialize variable. then Don't change (read only)
- prefer final to var whenever possible.

## 4. the const keyword

- const : a compile-time constant. ( very good for performance)

## 4. var, final and const

- var : can be set more than once.
- final : can be set only once.
- const : compile-time constants.

## 5. dynamic

```dart
void main() {
    var x =10;
    // error
    x = true;
    dynamic y = 10;
    y = true;
}
```
